import React, { useState, useEffect } from "react";
import axios from "axios";

const SelfieUpload = () => {
  const [selectedFile, setSelectedFile] = useState(null);
  const [message, setMessage] = useState("");
  const [uploadedSelfie, setUploadedSelfie] = useState(
    localStorage.getItem("uploadedSelfie") || null
  );
  const [imageData, setImageData] = useState(
    localStorage.getItem("imageData") || null
  );
  const [matchingImages, setMatchingImages] = useState([]); // להחזיק את התמונות שבהן הוא נוכח

  // Fetch selfie image from the server after upload
  useEffect(() => {
    if (uploadedSelfie && !imageData) {
      const fetchSelfie = async () => {
        try {
          const response = await axios.get(
            `http://localhost:5000/api/selfies/${encodeURIComponent(
              uploadedSelfie
            )}`,
            { responseType: "blob" }
          );
          const imageUrl = URL.createObjectURL(response.data);
          setImageData(imageUrl);
          localStorage.setItem("imageData", imageUrl); // שמירה ב-LocalStorage
        } catch (error) {
          console.error("Error fetching selfie:", error);
          setMessage("Error fetching selfie");
        }
      };

      fetchSelfie();
    }
  }, [uploadedSelfie, imageData]);

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    setSelectedFile(file);
  };

  const handleUpload = async (e) => {
    e.preventDefault();
    if (!selectedFile) {
      setMessage("Please upload a selfie.");
      return;
    }

    const formData = new FormData();
    formData.append("image", selectedFile);

    try {
      const response = await axios.post(
        "http://localhost:5000/api/selfies/upload",
        formData,
        {
          headers: {
            "Content-Type": "multipart/form-data",
          },
        }
      );

      setMessage(response.data.message);
      setUploadedSelfie(selectedFile.name);
      localStorage.setItem("uploadedSelfie", selectedFile.name);
      localStorage.removeItem("imageData"); // הסר את הישן כדי לקבל את החדש
    } catch (error) {
      console.error("Error uploading selfie:", error);
      setMessage("Error uploading selfie");
    }
  };

  const handleFaceRecognition = async () => {
    try {
      const formData = new FormData();
      formData.append("sourceImage", selectedFile);

      const response = await axios.post(
        "http://localhost:5000/match-faces", // שליחת בקשה לנתיב המתאים
        formData,
        {
          headers: {
            "Content-Type": "multipart/form-data",
          },
        }
      );

      // הצגת התמונות שבהן המשתמש נוכח
      const matches = response.data.FaceMatches;
      setMatchingImages(matches);
    } catch (error) {
      console.error("Error matching faces:", error);
      setMessage("Error matching faces");
    }
  };

  return (
    <div style={{ paddingTop: "100px" }}>
      <h1>Upload Your Selfie</h1>
      <form onSubmit={handleUpload}>
        <input type="file" accept="image/*" onChange={handleFileChange} />
        <button type="submit">Upload</button>
      </form>
      {message && <p>{message}</p>}

      {/* הצגת הסלפי שהועלה */}
      {imageData && (
        <div>
          <h2>Uploaded Selfie</h2>
          <img
            src={imageData}
            alt={`Uploaded selfie: ${uploadedSelfie}`}
            style={{ width: "150px", height: "150px", objectFit: "cover" }}
          />
        </div>
      )}

      {/* כפתור זיהוי פנים */}
      {uploadedSelfie && (
        <button onClick={handleFaceRecognition}>Identify Faces</button>
      )}

      {/* הצגת התמונות בהן המשתמש נוכח */}
      {matchingImages.length > 0 && (
        <div>
          <h2>Matching Images</h2>
          <div style={{ display: "flex", flexWrap: "wrap" }}>
            {matchingImages.map((image, index) => (
              <div key={index} style={{ margin: "10px" }}>
                <img
                  src={image.imageUrl}
                  alt={`Uploaded selfie: ${uploadedSelfie}`}
                  style={{
                    width: "150px",
                    height: "150px",
                    objectFit: "cover",
                  }}
                />
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
};

export default SelfieUpload;
